import React from 'react';
import './App.css';

function Contact() {
  return (
    <div className="Contact">
      <h2>Contact Us</h2>
      <p>Email: info@tourwebsite.com</p>
      <p>Phone: +1 (555) 123-4567</p>
    </div>
  );
}

export default Contact;
